import authService from "../services/AuthService";

export default {
  state: {
    isAuth: false,
  },
  getters: {},
  mutations: {
    changeIsAuth(state, payload) {
      state.isAuth = payload;
    },
  },
  actions: {
    async authorization(_, formData) {
      const response = await authService.login(formData);
      console.log("response -->", response);
    },
  },
};
